// import { jsPDF } from "jspdf"
const { jsPDF } = window.jspdf;
var font = '';
var callAddFont = function () {
this.addFileToVFS('VarelaRound-Regular-normal.ttf', font);
this.addFont('VarelaRound-Regular-normal.ttf', 'VarelaRound-Regular', 'normal');
};
jsPDF.API.events.push(['addFonts', callAddFont])
